# Fable Architecture

This document describes the internal architecture and design patterns used in Fable.

## Overview

Fable is built on a **Service Provider Pattern** architecture that provides dependency injection, service lifecycle management, and centralized configuration.

```
Fable (Core ServiceManager)
     Settings Manager (fable-settings)
     UUID Generator (fable-uuid)
     Logging System (fable-log)
     Service Registry
          Default Single-Instance Services (auto-instantiated)
          On-Demand Services (instantiated when needed)
          Custom Service Types (user-defined)
```

## Design Principles

### Inversion of Control (IoC)

Services depend on Fable rather than creating their own dependencies. Each service receives a reference to the Fable instance during construction, providing access to all other services and shared configuration.

```javascript
class MyService extends libFableServiceBase {
    constructor(pFable, pOptions, pServiceHash) {
        super(pFable, pOptions, pServiceHash);

        // Access other services through fable
        this.log = this.fable.log;
        this.settings = this.fable.settings;
    }
}
```

### Lazy Instantiation

Services can be registered without being instantiated, allowing for on-demand creation when first needed:

```javascript
// Register without instantiating
fable.addServiceType('ExpensiveService', ExpensiveServiceClass);

// Later, when needed
const service = fable.instantiateServiceProvider('ExpensiveService');
```

### Service Containers

Each service type maintains a map of instances, supporting multiple named instances of the same service type:

```javascript
// Create multiple instances of the same service type
const clientA = fable.instantiateServiceProvider('RestClient', {}, 'api-client');
const clientB = fable.instantiateServiceProvider('RestClient', {}, 'auth-client');

// Access via services map
fable.servicesMap.RestClient['api-client'];
fable.servicesMap.RestClient['auth-client'];
```

### Default Service Pattern

The first instance of each service type becomes the default accessor on the Fable object:

```javascript
// First instantiation becomes default
fable.instantiateServiceProvider('RestClient', {}, 'primary');

// Now accessible directly
fable.RestClient;           // The 'primary' instance
fable.services.RestClient;  // Same as above
```

## Initialization Phases

Fable initializes in distinct phases to ensure proper dependency ordering:

### Phase 0: Core State Setup

The lowest level state and service infrastructure is established:

```javascript
this.serviceType = 'ServiceManager';
this.serviceTypes = [];      // Array of registered service types
this.servicesMap = {};       // Map of instantiated services by type and hash
this.services = {};          // Map of default service instances
this.serviceClasses = {};    // Map of service class constructors
```

### Phase 1: Core Utility Services

Fundamental services required for Fable to operate:

```javascript
this.SettingsManager = new libFableSettings(pSettings);
this.UUID = new libFableUUID(this.SettingsManager.settings);
this.Logging = new libFableLog(this.SettingsManager.settings);
this.Logging.initialize();
```

### Phase 1.5: Self-Registration

Fable registers itself as a service, enabling consistent service access patterns:

```javascript
this.ServiceManager = this;
this.connectFable(this);
```

### Phase 2: Default Built-in Services

All default services are registered and optionally instantiated:

```javascript
// Auto-instantiated (available immediately)
this.addAndInstantiateServiceType('EnvironmentData', ...);
this.addAndInstantiateServiceType('Dates', ...);
this.addAndInstantiateServiceType('DataFormat', ...);
// ... etc

// On-demand (registered but not instantiated)
this.addServiceType('Template', ...);
this.addServiceType('RestClient', ...);
// ... etc
```

## Service Base Class

All Fable services extend `CoreServiceProviderBase` from `fable-serviceproviderbase`:

```javascript
class MyService extends libFableServiceBase {
    constructor(pFable, pOptions, pServiceHash) {
        super(pFable, pOptions, pServiceHash);

        this.serviceType = 'MyService';  // Required: identifies the service type
    }

    // Services automatically have:
    // - this.fable (reference to Fable instance)
    // - this.log (logging via fable.log)
    // - this.options (passed options)
    // - this.Hash (unique service instance identifier)
}
```

## Service Registration Methods

### `addServiceType(pServiceType, pServiceClass)`

Registers a service class without instantiation:

```javascript
fable.addServiceType('MyService', MyServiceClass);
```

### `addAndInstantiateServiceType(pServiceType, pServiceClass)`

Registers and immediately creates a default instance:

```javascript
fable.addAndInstantiateServiceType('MyService', MyServiceClass);
// Creates instance with hash 'MyService-Default'
```

### `instantiateServiceProvider(pServiceType, pOptions, pCustomServiceHash)`

Creates a new instance of a registered service:

```javascript
const service = fable.instantiateServiceProvider('MyService',
    { option: 'value' },
    'my-custom-hash'
);
```

### `instantiateServiceProviderFromPrototype(pServiceType, pOptions, pCustomServiceHash, pServicePrototype)`

Creates an instance using a custom class that may differ from the registered class:

```javascript
class CustomizedService extends MyServiceClass { /* ... */ }

const service = fable.instantiateServiceProviderFromPrototype(
    'MyService',
    options,
    'customized',
    CustomizedService
);
```

## Service Access Patterns

### Direct Property Access

Auto-instantiated services are available directly on the Fable instance:

```javascript
fable.Dates.dayJS().format('YYYY-MM-DD');
fable.Math.addPrecise('1.5', '2.5');
fable.DataFormat.formatterDollars(1234.56);
```

### Services Map Access

All instantiated services are accessible through the services map:

```javascript
fable.services.Dates;
fable.servicesMap.Dates['Dates-Default'];
```

### Factory Methods

Some services provide convenient factory methods:

```javascript
// Create a new Anticipate instance without registration
const anticipate = fable.newAnticipate();

// Create a new Manifest instance without registration
const manifest = fable.newManyfest(definition);
```

## Configuration Flow

Settings flow from initialization through all services:

```
User Config  SettingsManager  Fable.settings  All Services

              fable-settings
              (precedent-based
               config merging)
```

Services access configuration through:

```javascript
this.fable.settings.SomeSetting;
this.fable.SettingsManager.settings;
```

## Logging Architecture

The logging system supports multiple output streams:

```
Application Code  fable.log  Log Router  Stream 1 (console)
                                          Stream 2 (file)
                                          Stream 3 (MongoDB)
                                          Stream N (custom)
```

Log levels: `trace`, `debug`, `info`, `warn`, `error`, `fatal`

Custom log providers can be created by extending `LogProviderBase`:

```javascript
const LogProviderBase = require('fable').LogProviderBase;

class CustomLogProvider extends LogProviderBase {
    write(pLogEntry) {
        // Custom logging implementation
    }
}
```

## Browser Compatibility

Fable supports browser environments through service remapping:

```javascript
// package.json browser field
{
    "browser": {
        "./source/service/Fable-Service-EnvironmentData.js":
            "./source/service/Fable-Service-EnvironmentData-Web.js",
        "./source/service/Fable-Service-FilePersistence.js":
            "./source/service/Fable-Service-FilePersistence-Web.js"
    }
}
```

The `dist/` folder contains browserified bundles for direct browser use.

## Extending Fable

### Creating Custom Services

```javascript
const libFableServiceBase = require('fable-serviceproviderbase');

class MyCustomService extends libFableServiceBase {
    constructor(pFable, pOptions, pServiceHash) {
        super(pFable, pOptions, pServiceHash);
        this.serviceType = 'MyCustomService';
    }

    myMethod() {
        this.log.info('Doing something');
        return this.fable.Math.addPrecise('1', '2');
    }
}

// Register with Fable
fable.addAndInstantiateServiceType('MyCustomService', MyCustomService);

// Use it
fable.MyCustomService.myMethod();
```

### Service Initialization Hook

For advanced scenarios, Fable supports an extra initialization callback:

```javascript
fable.extraServiceInitialization = (pService) => {
    // Perform additional setup on every service
    pService.customProperty = 'value';
    return pService;
};
```

# Anticipate Service

The Anticipate service provides asynchronous operation sequencing, allowing you to chain operations and manage async workflows.

## Access

```javascript
// On-demand service - instantiate when needed
const tmpAnticipate = fable.instantiateServiceProvider('Anticipate');

// Or use the factory method (creates unregistered instance)
const tmpAnticipate = fable.newAnticipate();
```

## Basic Usage

### Sequential Operations

```javascript
const tmpAnticipate = fable.newAnticipate();

tmpAnticipate.anticipate(function (fCallback)
{
	console.log('Executing step 1');
	setTimeout(function ()
	{
		console.log('Step 1 done');
		fCallback();
	}, 100);
});
tmpAnticipate.anticipate(function (fCallback)
{
	console.log('Executing step 2');
	setTimeout(function ()
	{
		console.log('Step 2 done');
		fCallback();
	}, 100);
});
tmpAnticipate.anticipate(function (fCallback)
{
	console.log('Executing step 3');
	fCallback();
});
tmpAnticipate.wait(function (pError)
{
	if (pError)
	{
		console.error('Failed:', pError);
	}
	else
	{
		console.log('All steps completed');
	}
});
```

### Sharing State Between Steps

Since Anticipate callbacks receive only `fCallback`, use closure scope or external variables to share data between steps:

```javascript
const tmpAnticipate = fable.newAnticipate();
let tmpUser = null;
let tmpPreferences = null;

tmpAnticipate.anticipate(function (fCallback)
{
	fetchUser(123, function (pUser)
	{
		tmpUser = pUser;
		fCallback();
	});
});
tmpAnticipate.anticipate(function (fCallback)
{
	loadPreferences(tmpUser.id, function (pPrefs)
	{
		tmpPreferences = pPrefs;
		fCallback();
	});
});
tmpAnticipate.anticipate(function (fCallback)
{
	render(tmpUser, tmpPreferences);
	fCallback();
});
tmpAnticipate.wait(function (pError)
{
	if (pError)
	{
		console.error('Workflow failed:', pError);
	}
});
```

## API Reference

### anticipate(fAsynchronousFunction)

Add an asynchronous operation to the queue. Operations run sequentially by default (one at a time).

```javascript
tmpAnticipate.anticipate(function (fCallback)
{
	// Do async work
	fCallback();  // Call when done, or fCallback(pError) to signal failure
});
```

The step function receives one parameter:
- `fCallback`  Callback to signal completion. Pass an error to bail out: `fCallback(new Error('something failed'))`

### wait(fCallback)

Register a callback to run when all queued operations complete (or when an error occurs):

```javascript
tmpAnticipate.wait(function (pError)
{
	if (pError)
	{
		console.error('Error:', pError);
	}
});
```

### maxOperations

Control concurrency. Default is `1` (sequential). Set higher for parallel execution:

```javascript
const tmpAnticipate = fable.newAnticipate();
tmpAnticipate.maxOperations = 5;  // Run up to 5 operations concurrently
```

## Error Handling

### Error Bailout

When an operation passes an error to its callback, remaining queued operations are skipped and the `wait` callback fires immediately with the error:

```javascript
const tmpAnticipate = fable.newAnticipate();
let tmpPostErrorRan = false;

tmpAnticipate.anticipate(function (fCallback)
{
	console.log('Step 1 running');
	fCallback();
});
tmpAnticipate.anticipate(function (fCallback)
{
	console.log('Step 2 failing');
	fCallback(new Error('Something went wrong'));
});
tmpAnticipate.anticipate(function (fCallback)
{
	// This will NOT run because the previous step errored
	tmpPostErrorRan = true;
	fCallback();
});
tmpAnticipate.wait(function (pError)
{
	console.log('Error:', pError);          // Error: Something went wrong
	console.log('Step 3 ran:', tmpPostErrorRan);  // false
});
```

### Error Recovery

To handle errors without bailing out, catch them inside the step and continue:

```javascript
const tmpAnticipate = fable.newAnticipate();
let tmpRecoveredError = null;

tmpAnticipate.anticipate(function (fCallback)
{
	try
	{
		riskyOperation();
		fCallback();
	}
	catch (pError)
	{
		tmpRecoveredError = pError;
		fCallback();  // No error passed  pipeline continues
	}
});
tmpAnticipate.anticipate(function (fCallback)
{
	if (tmpRecoveredError)
	{
		console.log('Recovered from:', tmpRecoveredError);
	}
	fCallback();
});
tmpAnticipate.wait(function (pError)
{
	console.log('Pipeline completed');
});
```

## Use Cases

### Database Migrations

```javascript
const tmpMigrate = fable.newAnticipate();

tmpMigrate.anticipate(function (fCallback)
{
	db.query('CREATE TABLE users...', fCallback);
});
tmpMigrate.anticipate(function (fCallback)
{
	db.query('CREATE TABLE posts...', fCallback);
});
tmpMigrate.anticipate(function (fCallback)
{
	db.query('CREATE INDEX...', fCallback);
});
tmpMigrate.wait(function (pError)
{
	if (pError) console.error('Migration failed:', pError);
	else console.log('Migration complete');
});
```

### API Request Chains

```javascript
const tmpWorkflow = fable.newAnticipate();
let tmpToken = null;
let tmpData = null;

tmpWorkflow.anticipate(function (fCallback)
{
	api.login(credentials, function (pToken)
	{
		tmpToken = pToken;
		fCallback();
	});
});
tmpWorkflow.anticipate(function (fCallback)
{
	api.getData(tmpToken, function (pData)
	{
		tmpData = pData;
		fCallback();
	});
});
tmpWorkflow.anticipate(function (fCallback)
{
	process(tmpData);
	fCallback();
});
tmpWorkflow.wait(function (pError)
{
	if (pError) console.error('Workflow failed:', pError);
});
```

### Parallel Operations

```javascript
const tmpParallel = fable.newAnticipate();
tmpParallel.maxOperations = 3;  // Run up to 3 at a time

tmpParallel.anticipate(function (fCallback)
{
	fetchFromServiceA(function () { fCallback(); });
});
tmpParallel.anticipate(function (fCallback)
{
	fetchFromServiceB(function () { fCallback(); });
});
tmpParallel.anticipate(function (fCallback)
{
	fetchFromServiceC(function () { fCallback(); });
});
tmpParallel.wait(function (pError)
{
	console.log('All fetches complete');
});
```

### Build Pipeline

```javascript
const tmpBuild = fable.newAnticipate();

tmpBuild.anticipate(function (fCallback)
{
	cleanBuildDir(fCallback);
});
tmpBuild.anticipate(function (fCallback)
{
	compile(fCallback);
});
tmpBuild.anticipate(function (fCallback)
{
	bundle(fCallback);
});
tmpBuild.anticipate(function (fCallback)
{
	minify(fCallback);
});
tmpBuild.wait(function (pError)
{
	if (pError) throw pError;
	console.log('Build complete');
});
```

## Multiple Instances

Create multiple independent workflows:

```javascript
const tmpUserWorkflow = fable.newAnticipate();
const tmpOrderWorkflow = fable.newAnticipate();

// These run independently
tmpUserWorkflow.anticipate(function (fCallback) { /* ... */ fCallback(); });
tmpUserWorkflow.wait(function (pError) { /* ... */ });

tmpOrderWorkflow.anticipate(function (fCallback) { /* ... */ fCallback(); });
tmpOrderWorkflow.wait(function (pError) { /* ... */ });
```

# CSVParser Service

The CSVParser service provides line-by-line CSV parsing with support for multi-line quoted fields, escaped quotes, and configurable delimiters. It is designed for streaming line-by-line parsing rather than whole-string parsing.

## Access

```javascript
// On-demand service - instantiate when needed
const csvParser = fable.instantiateServiceProvider('CSVParser', {}, 'CSV Parser-123');
```

## Basic Usage

### Line-by-Line Parsing

The primary method is `parseCSVLine()`, which processes one line at a time and returns a parsed record (or `false` if the line is part of a multi-line quoted field or is the header row):

```javascript
const libFS = require('fs');
const libReadline = require('readline');

const csvParser = fable.instantiateServiceProvider('CSVParser');
const records = [];

const rl = libReadline.createInterface({
    input: libFS.createReadStream('data.csv'),
    crlfDelay: Infinity
});

rl.on('line', (line) => {
    let record = csvParser.parseCSVLine(line);
    if (record) {
        records.push(record);
    }
});

rl.on('close', () => {
    console.log(`Parsed ${records.length} records`);
    // records[0] is an object like { name: 'John', age: '30', city: 'New York' }
});
```

### Using FilePersistence Wrapper

The FilePersistence service provides a convenience method for CSV reading:

```javascript
fable.instantiateServiceProvider('FilePersistence');

fable.FilePersistence.readFileCSV('data.csv', {},
    (record) => {
        // Called for each parsed record (as a JSON object)
        console.log(record.name, record.age);
    },
    () => {
        // Called when parsing is complete
        console.log('Done!');
    });
```

## How Parsing Works

The CSVParser is stateful and processes lines sequentially:

1. The first line is treated as a header row by default (sets column names)
2. Each subsequent line is parsed and emitted as a JSON object keyed by header names
3. Multi-line quoted fields are accumulated across calls to `parseCSVLine()` until the closing quote is found

### Return Values from `parseCSVLine()`

- Returns a **JSON object** (keyed by header names) for a successfully parsed data row
- Returns **`false`** for header rows (when `EmitHeader` is `false`, the default)
- Returns **`false`** when in the middle of a multi-line quoted field

## Configuration Properties

Set these properties on the parser instance after creation:

```javascript
const csvParser = fable.instantiateServiceProvider('CSVParser');

csvParser.Delimiter = ';';           // Default: ','
csvParser.QuoteCharacter = "'";      // Default: '"'
csvParser.HasHeader = true;          // Default: true - first line is header
csvParser.HeaderLineIndex = 0;       // Default: 0 - which line is the header
csvParser.EmitJSON = true;           // Default: true - emit objects vs arrays
csvParser.EmitHeader = false;        // Default: false - return header row or skip it
csvParser.EscapedQuoteString = '&quot;';  // Default: '&quot;' - replacement for escaped quotes
```

## Methods

### `parseCSVLine(lineString)`

Parse a single line of CSV. Returns a record object, an array, or `false`.

### `setHeader(headerArray)`

Manually set column headers (an array of strings):

```javascript
csvParser.setHeader(['name', 'age', 'city']);
```

### `marshalRowToJSON(rowArray)`

Convert a row array into a JSON object using the current headers:

```javascript
csvParser.setHeader(['name', 'age']);
csvParser.marshalRowToJSON(['John', '30']);
// Returns { name: 'John', age: '30' }
```

### `resetRowState()`

Reset the current row accumulation state. Useful if you need to discard a partially parsed row.

### `emitRow(formatAsJSON)`

Emit the currently accumulated row. If `formatAsJSON` is true (default), returns a JSON object; otherwise returns the raw array.

## Parser State Properties

```javascript
csvParser.LinesParsed   // Total number of lines processed
csvParser.RowsEmitted   // Total number of data rows emitted
csvParser.InQuote       // Whether currently inside a quoted field
csvParser.Header        // Current header array
csvParser.HeaderFieldNames  // Trimmed header field names used as object keys
```

## Handling Special Cases

### Multi-line Quoted Fields

The parser handles fields that span multiple lines when enclosed in quotes. It tracks quote state across calls to `parseCSVLine()` and accumulates the field until the closing quote is found.

### Escaped Quotes

Double quotes within a quoted field (e.g., `""`) are replaced with the `EscapedQuoteString` value (default `&quot;`).

### Extra Columns

If a row has more columns than the header, extra columns are keyed by their numeric index (e.g., `'3'`, `'4'`).

## Notes

- All values are returned as strings
- The parser is designed for streaming/line-by-line use, not whole-file-at-once parsing
- Carriage returns (`\r`) are automatically stripped from fields
- The parser is stateful  create a new instance for each file you parse

# Dates Service

The Dates service provides date manipulation functionality using [day.js](https://day.js.org/) with several plugins pre-loaded.

## Access

```javascript
// Auto-instantiated, available directly
fable.Dates
```

## Direct day.js Access

```javascript
// Access the day.js library directly
fable.Dates.dayJS();                           // Current date/time
fable.Dates.dayJS('2024-01-15');               // Parse a date
fable.Dates.dayJS('2024-01-15').format('YYYY-MM-DD');
```

## Pre-loaded Plugins

The following day.js plugins are automatically loaded:

- **weekOfYear** - Get the week number of the year
- **weekday** - Get/set the day of the week
- **isoWeek** - ISO week operations
- **timezone** - Timezone support
- **relativeTime** - "2 hours ago" style formatting
- **utc** - UTC mode support
- **advancedFormat** - Additional format tokens

## Date Difference Methods

All difference methods accept dates as strings, Date objects, or timestamps.

### Milliseconds

```javascript
fable.Dates.dateMillisecondDifference('2024-01-01', '2024-01-02');
// Returns: 86400000
```

### Seconds

```javascript
fable.Dates.dateSecondDifference('2024-01-01 00:00:00', '2024-01-01 00:01:30');
// Returns: 90
```

### Minutes

```javascript
fable.Dates.dateMinuteDifference('2024-01-01 00:00', '2024-01-01 02:30');
// Returns: 150
```

### Hours

```javascript
fable.Dates.dateHourDifference('2024-01-01', '2024-01-02');
// Returns: 24
```

### Days

```javascript
fable.Dates.dateDayDifference('2024-01-01', '2024-01-15');
// Returns: 14
```

### Weeks

```javascript
fable.Dates.dateWeekDifference('2024-01-01', '2024-02-01');
// Returns: 4
```

### Months

```javascript
fable.Dates.dateMonthDifference('2024-01-01', '2024-06-01');
// Returns: 5
```

### Years

```javascript
fable.Dates.dateYearDifference('2020-01-01', '2024-01-01');
// Returns: 4
```

### Require End Date

All difference methods accept an optional third parameter to require the end date:

```javascript
// Returns NaN if end date is not provided
fable.Dates.dateDayDifference('2024-01-01', null, true);  // Returns NaN
```

## Date Addition Methods

### Add Milliseconds

```javascript
fable.Dates.dateAddMilliseconds('2024-01-01T00:00:00.000Z', 5000);
// Returns: '2024-01-01T00:00:05.000Z'
```

### Add Seconds

```javascript
fable.Dates.dateAddSeconds('2024-01-01T00:00:00.000Z', 30);
// Returns: '2024-01-01T00:00:30.000Z'
```

### Add Minutes

```javascript
